import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Thomas and Sharon's Initiative Tracker
      </header>
      <body>
        <input name="initiative" />
        <input name="charactername" />
        <input name="movement" />
        <input name="hp" />
        <input name="ac" />
        <input name="conditions" />
      </body>
    </div>
  );
}

export default App;
